> Top News Bush team builds data operation with eye on general election FILE - In this Oct. 10, 2015 file photo, Republican presidential candidate, former Florida Gov. Jeb Bush speaks a tailgate party before an NCAA college football game between Tennessee and Georgia, in Knoxville, Tenn. Months before primary voters cast the first ballots of the 2016 presidential campaign, Bush and his allies are deep into the work of building a data-driven operation to turn out voters in the general election _ spending heavily on the assumption the former Florida governor will overcome his sluggish start and ultimately win the Republican nomination. (AP Photo/Wade Payne, File) 
